INSERT INTO cmpdb.video (video_id, title, description, video_url, photo_url, rank_number, genre) VALUES (20, 'Bøsseskoven', 'En teaterskuespiller har svært ved at tilfredsstille sin autoritære instruktør med en særligt vanskelig monolog. En pensioneret gymnasielærer begynder at tvivle på sin seksualitet og på sit ægteskab. De søger begge ud i skoven for at finde løsningen på deres problemer.', 'http://www.ekkofilm.dk/media/dyn/film/video/bosseskoven.mp4?_=1DfEsw', 'http://www.ekkofilm.dk/media/dyn/film/still/generated/1230_686x386.jpeg', 7, 'short_film');
